import UserItem from "../UserItem/UserItem";

const UserList = ({users, loading}) => {

    return(
        <>
        {loading === true && <h2>Loading...</h2>}
        {loading === false &&
            <ul>
                {users && users.map(({id, email, name, phone, photo, position}) => (
                    <UserItem 
                        key={id} 
                        id={id} 
                        email={email} 
                        name={name}
                        phone={phone} 
                        photo={photo} 
                        position={position}
                    />
                ))}
            </ul>}
        </>
    )
}

export default UserList;
